import React from 'react';

function ProgressBar() {
  const progressBarStyles = {
    width: '100%',
    height: '15px',
    backgroundColor: '#f1f1f1',
    borderRadius: '10px',
    position: 'relative',
  };

  const progressBarFillStyles = {
    height: '100%',
    backgroundColor: '#4CAF50',
    borderRadius: '10px',
    position: 'absolute',
    top: '0',
    left: '0',
  };

  const progressBarLabelStyles = {
    position: 'absolute',
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%)',
    color: '#333',
    fontSize: '12px',
    fontWeight: 'bold',
  };

  const containerStyles = {
    maxWidth: '600px',
    margin: '0 auto',
    textAlign: 'center',
  };

  return (
    <section id="skills">
      <h2>Skills</h2>
      <div style={containerStyles}>
        <div style={{ display: 'inline-block', margin: '10px' }}>
          <div style={progressBarStyles}>
            <div style={{ ...progressBarFillStyles, width: '90%' }}></div>
          </div>
          <div style={progressBarLabelStyles}>90%</div>
          <div>HTML/CSS</div>
        </div>
        <div style={{ display: 'inline-block', margin: '10px' }}>
          <div style={progressBarStyles}>
            <div style={{ ...progressBarFillStyles, width: '80%' }}></div>
          </div>
          <div style={progressBarLabelStyles}>80%</div>
          <div>JavaScript</div>
        </div>
        <div style={{ display: 'inline-block', margin: '10px' }}>
          <div style={progressBarStyles}>
            <div style={{ ...progressBarFillStyles, width: '70%' }}></div>
          </div>
          <div style={progressBarLabelStyles}>70%</div>
          <div>React</div>
        </div>
      </div>
    </section>
  );
}

export default ProgressBar;
